%[text] %[text:anchor:T_F7E8B9B1] # **Creating a Flight Tracking Dashboard, Part 3: Assembling the Dashboard**
%[text] %[text:anchor:H_701E9FF1] **Overview**
%[text] In the [second blog post](https://blogs.mathworks.com/graphics-and-apps/2024/07/31/creating-a-flight-tracking-dashboard-part-2-developing-an-aircraft-chart/) of this series, we saw how to develop a custom chart to encapsulate the 3D graphics and helper functions used to visualize the aircraft. We also discussed how a similar approach could be used to create a chart showing the current position of the aircraft on its flight route.
%[text] In this post, we'll see how to assemble the flight tracking dashboard by developing a series of modular components. First, we'll develop classes to store and organize the flight data. These classes represent the backend of the dashboard. Next, we'll create a series of frontend components for visualizing and manipulating the flight data. This separation of concerns follows the model-view-controller software architecture pattern for application development, explained in more detail in this [technical article](https://www.mathworks.com/company/technical-articles/developing-matlab-apps-using-the-model-view-controller-pattern.html) \[1\]. We will also make use of the latest release of [GUI Layout Toolbox](https://www.mathworks.com/matlabcentral/fileexchange/47982-gui-layout-toolbox) (which is now fully compatible with web graphics) to help organize the frontend components and allow the end user to configure the dashboard layout.
%[text] Finally, we'll assemble the various components into a dashboard application suitable for sharing with end users, and discuss the options available for deploying the dashboard, focussing on web deployment. By the end of this post, we'll have a fully functional dashboard for tracking flight data running as a web app.
%[text] All the code used in this series of blog posts is available on GitHub.
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] ## Create a storage class for the flight data.
%[text] Our dashboard is designed to display flight data such as the position, altitude, and speed of the aircraft. These variables are all time series, so storing them in a `timetable` is a natural choice. We've created some (simulated) data representing a 1-hour flight between Glasgow and Stansted airports in the UK.
tt = readtimetable( "FlightPath.csv" );
disp( head( tt ) ) %[output:8461c0f4]
%[text] Timetables are flexible and enable us to freely add and remove variables. We will add some derived variables to the timetable, such as the heading, climb rate, and slip. However, if our intention is to deploy an application to end users, we may want to limit the ways in which they can modify the application data, which is not possible using a standard MATLAB data type such as a timetable. On the other hand, using object-oriented programming means that we can provide read-only access to a data set, and guarantee that the timetable contains all the variables required for the application.
%[text] We'll create a new class `FlightPathData` to store the timetable containing the flight data. This class contains local functions `mustBeFlightDataTimetable` for validating that the timetable contains the expected variables, and `defaultFlightDataTimetable` for initializing an empty timetable of the required form.
%[text] ```matlabCodeExample
%[text] classdef FlightPathData
%[text]     %FLIGHTPATHDATA Stores data for a single flight path.
%[text] 
%[text]     properties ( Access = private )
%[text]         % Timetable containing flight path data.
%[text]         FlightDataTimetable(:, :) timetable {mustBeFlightDataTimetable} = defaultFlightDataTimetable()
%[text]     end % properties ( Access = private )
%[text] 
%[text] end % classdef
%[text] ```
%[text] We handle data input using the class constructor. This takes a filename as input, and imports the data using `readtimetable`. The validation that we've built in ensures that the imported data has all the variables we need.
%[text] ```matlabCodeExample
%[text] function obj = FlightPathData( filename )
%[text]     %FLIGHTPATHDATA Construct a FlightPathData object.
%[text] 
%[text]     arguments ( Input )
%[text]         filename(:, 1) string {mustBeFile, mustBeScalarOrEmpty} = string.empty( 0, 1 )
%[text]     end % arguments ( Input )
%[text] 
%[text]     if ~isempty( filename )
%[text]         obj.FlightDataTimetable = readtimetable( filename );
%[text]     end % if
%[text] 
%[text] end % constructor
%[text] ```
%[text] Note that a `FlightPathData` object can be constructed without entering a filename. In this case, the object will have empty properties. It's good practice to support zero-input argument syntax for a data storage class, because it means that it's easier to support arrays of objects. For example, we might need an object array if our application supports loading multiple datasets simultaneously.
%[text] We construct a `FlightPathData` object from the file `FlightPath.csv` containing flight data.
FPD = FlightPathData( "FlightPath.csv" );
%[text] To allow client code access to the data that it needs, we need to provide a user-friendly API. For example, the dashboard will need to access the `Time` variable of the timetable, in order to create different plots. We can provide read-only access to `Time` (and all other timetable variables) by [customizing dot indexing](https://www.mathworks.com/help/matlab/ref/matlab.mixin.indexing.redefinesdot-class.html) for our class. In this case we simply pass the dot indexing onto the timetable when read access is requested, whilst preventing dot indexing from being used to assign new values.
%[text] ```matlabCodeExample
%[text] classdef FlightPathData < matlab.mixin.RedefinesDot
%[text]     %FLIGHTPATHDATA Stores data for a single flight path.
%[text] 
%[text]     methods ( Access = protected )
%[text] 
%[text]         function varargout = dotReference( obj, indexOp )
%[text] 
%[text]             [varargout{1:nargout}] = obj.FlightDataTimetable.(indexOp);
%[text] 
%[text]         end % dotReference
%[text] 
%[text]         function varargout = dotAssign( ~, ~, varargin ) %#ok<STOUT>
%[text] 
%[text]             error( "FlightPathData:DotAssignment", ...
%[text]                 "FlightPathData objects do not support dot assignment." )
%[text] 
%[text]         end % dotAssign
%[text] 
%[text]         function n = dotListLength( obj, indexOp, indexContext )
%[text] 
%[text]             n = listLength( obj.FlightDataTimetable, ...
%[text]                 indexOp, indexContext );
%[text] 
%[text]         end % dotListLength
%[text] 
%[text]     end % methods
%[text] 
%[text] end % classdef
%[text] ```
%[text] Similarly, by [redefining brace indexing](https://www.mathworks.com/help/matlab/ref/matlab.mixin.indexing.redefinesbrace-class.html), we allow clients to look up the value of a variable at a specific time during the flight. This feature is needed by the dashboard elements that show the current state of the flight.
%[text] As an example, we'll plot the airspeed throughout the flight and highlight a specific point.
figure %[output:3de43751]
plot( FPD.Time, FPD.Airspeed, "LineWidth", 1.5 ) %[output:3de43751]
xlabel( "Time" ) %[output:3de43751]
ylabel( "Airspeed (knots)" ) %[output:3de43751]
title( "Airspeed" ) %[output:3de43751]
grid on %[output:3de43751]
%[text] Highlight a specific point during the flight.
t = datetime( 2024, 6, 30, 10, 15, 0 );
v = FPD{t, "Airspeed"};
hold on %[output:3de43751]
plot( t, v, "r*" ) %[output:3de43751]
%%
%[text] ## Create the application data model.
%[text] The `FlightPathData` class provides data storage. For a modular application such as a dashboard, we also need the ability to maintain state information. Moreover, when the end user interacts with the dashboard controls, we need to notify other parts of the application of any changes. This information sharing is achieved through the use of [events and listeners](https://www.mathworks.com/help/matlab/matlab_oop/learning-to-use-events-and-listeners.html), which also avoids unnecessary coupling between different parts of the application. Since only handle classes can maintain state and issue events, we create a handle class wrapper `FlightDashboardModel` for our data storage class `FlightPathData`.
%[text] ![](text:image:4f93)
%[text] We equip `FlightDashboardModel` with an `import` method for loading data from a file, and a `reset` method for removing the loaded data. We add the property `CurrentTime`, a scalar `datetime` value, to represent the state of the application. We equip the model with the events `CurrentTimeChanged` and `FlightDataChanged`. For more information about designing a model class, see \[1\].
%%
%[text] ## Define a superclass for implementation of the views and controllers.
%[text] The views and controllers that comprise the dashboard frontend have several things in common. First, they should all have a reference to the model (`FlightDashboardModel`), so that they can access and modify the application data and state during dashboard operation. Next, to respond dynamically to the model events `CurrentTimeChanged` and `FlightDataChanged`, the views and controllers should have listeners with corresponding callback functions `onCurrentTimeChanged` and `onFlightDataChanged`. All frontend components must implement these callbacks, but the concrete implementation will necessarily be different between the various views and controllers. We can enforce this behavioral contract by using [abstract methods](https://www.mathworks.com/help/matlab/matlab_oop/abstract-classes-and-interfaces.html).
%[text] MATLAB's [`ComponentContainer`](https://www.mathworks.com/help/matlab/ref/matlab.ui.componentcontainer.componentcontainer-class.html) class provides a convenient means to implement frontend components. It equips each view and controller with a container object to hold the required graphics and control objects, provides standard public properties such as `Parent`, `Position`, `Units`, and `Visible`, and manages the component's lifecycle. On construction, we remove the autoparenting behavior of the component and ensure that it spans its parent by setting the following properties:
%[text] - `Parent = []`
%[text] - `Units = "normalized"`
%[text] - `Position = [0, 0, 1, 1]` \
%[text] Finally, we note that the R2024b release saw the introduction of [weak reference handles](https://www.mathworks.com/help/matlab/matlab_oop/weak-reference-handles.html). This enables a reference to an object to be created without interfering with the lifecycle of the underlying object. To avoid creating a strong reference cycle in the component via the object reference captured by the listener callback function handle, we create a weak reference to the component and access its `Handle` property in the callback function. From R2024b onwards, avoiding unnecessary strong reference cycles is the recommended best practice to help improve future code performance.
%[text] ```matlabCodeExample
%[text] weakObj = matlab.lang.WeakReference( obj );
%[text] obj.FlightDataChangedListener = listener( obj.Model, "FlightDataChanged", @( s, e ) weakObj.Handle.onFlightDataChanged( s, e ) );
%[text] obj.CurrentTimeChangedListener = listener( obj.Model, "CurrentTimeChanged", @( s, e ) weakObj.Handle.onCurrentTimeChanged( s, e ) );
%[text] ```
%[text] See `FlightDashboardComponent` for full implementation details. This class is the common superclass for all of the dashboard's frontend components.
%[text] ![](text:image:255e)
%%
%[text] ## Create views by aggregation with charts.
%[text] In the [previous blog post](https://blogs.mathworks.com/graphics-and-apps/2024/07/31/creating-a-flight-tracking-dashboard-part-2-developing-an-aircraft-chart/), we saw how to encapsulate a related set of graphics objects and functions as a custom chart. We can use charts as standalone objects within scripts and functions, or embed them in a larger application. In this example, we'll create two views by aggregation \[2\] with charts that were created previously. Specifically,
%[text] - `AircraftAttitudeView` is aggregated with the `AircraftChart`, and
%[text] - `MapView` is aggregated with the `PositionChart`. \
%[text] Creating a view via aggregation with a chart is particularly simple: the view stores a reference to the chart as one of its private properties, and instantiates the chart in its `setup` method. When the view responds to model events through its implementation of the required listener callbacks, it updates the chart using the chart's public properties or methods.
%[text] ![](text:image:6e67)
%%
%[text] ## Define class hierarchies to simplify view implementation.
%[text] We can identify two groups of views that share implementation details.
%[text] - There are six views that display a specific flight instrument (airspeed, horizon, altitude, turn, heading, and climb rate). These share the same architecture, using a box panel (`uix.BoxPanel`) from [GUI Layout Toolbox](https://www.mathworks.com/matlabcentral/fileexchange/47982-gui-layout-toolbox), an intermediate [grid layout](https://www.mathworks.com/help/matlab/ref/uigridlayout.html) and [panel](https://www.mathworks.com/help/matlab/ref/uipanel.html), and a [flight instrument](https://www.mathworks.com/help/aerotbx/flight-instruments.html) component from [Aerospace Toolbox](https://www.mathworks.com/products/aerospace-toolbox.html).
%[text] - There are four views that use a text-based display to show the current value of a variable (time, latitude, longitude, and yaw). These views use the same graphics objects (an [axes](https://www.mathworks.com/help/matlab/ref/axes.html), [rectangle](https://www.mathworks.com/help/matlab/ref/rectangle.html), and [text](https://www.mathworks.com/help/matlab/ref/text.html) box). \
%[text] To share common code between multiple classes, we create a [class hierarchy](https://www.mathworks.com/help/matlab/matlab_oop/hierarchies-of-classes-concepts.html). This enables future modifications to the shared code to be made in a single location, rather than having to make the same change across a number of files.
%[text] For the first group of views, we define a superclass `FlightInstrumentView` that contains the shared graphics objects and an abstract property `Instrument`. It's the responsibility of each subclass to define the appropriate flight instrument (e.g., using [`uiaeroairspeed`](https://www.mathworks.com/help/aerotbx/ug/uiaeroairspeed.html) or [`uiaeroaltimeter`](https://www.mathworks.com/help/aerotbx/ug/uiaeroaltimeter.html)).
%[text] 
%[text] ![](text:image:9020)
%[text] For example, we could create `AltitudeView` and `HorizonView` objects within the same layout. We use the `uix.HBox` component from GUI Layout Toolbox to create a horizontal layout.
FDM = FlightDashboardModel( "FlightPath.csv" );

f = uifigure; %[output:04d59e83]
hb = uix.HBox( "Parent", f, "Padding", 5, "Spacing", 5 ); %[output:04d59e83]
AV = AltitudeView( FDM, "Parent", hb ); %[output:04d59e83]
HV = HorizonView( FDM, "Parent", hb ); %[output:04d59e83]
%[text] Similarly, for the text-based views, we define a superclass `TextAreaView` to contain the shared graphics and a helper method `updateTextArea` that allows subclasses to modify the displayed text in response to model events. In this case, the shared graphics are encapsulated in a reusable component `RectangularTextArea` that we'll discuss in more detail in a later section.
%[text] ![](text:image:3b5f)
%%
%[text] ## Create a view of the flight path using a `geoglobe` object.
%[text] In the `PositionChart` mentioned above, we plot the route and current position of the aircraft using [`geoplot`](https://www.mathworks.com/help/matlab/ref/geoplot.html) objects on a [`geoaxes`](https://www.mathworks.com/help/matlab/ref/geoaxes.html). These graphics objects are available in base MATLAB. In addition, [Mapping Toolbox](https://www.mathworks.com/products/mapping.html) provides the [`geoglobe`](https://www.mathworks.com/help/matlab/ref/geoplot.html) and [`geoplot3`](https://www.mathworks.com/help/releases/R2025a/map/ref/geoplot3.html) visualization functions for visualizing lines and points on a 3D globe. We'll use these functions to create the `GlobeView` class. This provides an interactive view of the aircraft's current position and flight route on the globe, including terrain information.
FDM = FlightDashboardModel( "FlightPath.csv" );

f = uifigure;
GV = GlobeView( FDM, "Parent", f );
%[text] ![](text:image:4808)
%[text] If you have access to the [Satellite Communication Toolbox](https://www.mathworks.com/products/satellite-communications.html), there are additional aircraft assets and map-based visualizations available for tracking applications. Here's an [example](https://www.mathworks.com/help/satcom/ug/aircraft-ads-b-out-airport-and-satellite-connectivity.html) \[3\] that shows communication links between an aircraft and a satellite constellation.
%[text] The `GlobeView` class manages the geographic globe and two line objects created using the `geoplot3` function. One line object is used to plot the flight route, and the second is used to indicate the current position of the aircraft.
%[text] ![](text:image:1689)
%%
%[text] ## Design reusable modular components for use within the views and controllers.
%[text] To maximize code reuse between multiple applications, it's good practice to refactor out modular components (or *widgets*) from views and controllers when developing the frontend. This avoids individual views and controllers becoming overly long or complicated, and means that the same component can be reused within the same app or between different apps.
%[text] We've already seen above that charts are good examples of reusable components - in our case, we can use `AircraftChart` and `PositionChart` as part of a script or function that we're writing, outside the context of an interactive application.
%[text] Two generic widgets in our dashboard are the playback controls for modifying the current time during the simulation, and the rectangular text area for displaying the current value of a flight variable.
%[text] The class `PlaybackControls` creates the first widget. Since this uses user interface control objects, this class is derived from `ComponentContainer`.
f = uifigure; %[output:398623de]
g = uigridlayout( f, [1, 1], "Padding", 0 ); %[output:398623de]
PC = PlaybackControls( "Parent", g ); %[output:398623de]
f.Position(4) = 50; %[output:398623de]
%[text] Likewise, the `RectangularTextArea` class defines the second reusable widget. This widget is reused in the dashboard across the second group of views in the class hierarchies discussed above. Since this widget uses an axes together with some axes children, we derive this class from `ChartContainer`. For further information about using `ChartContainer` and `ComponentContainer` to create modular components, see \[4\].
f = uifigure; %[output:717a7f33]
g = uigridlayout( f, [1, 1], "Padding", 0 ); %[output:717a7f33]
RTA = RectangularTextArea( "Parent", g, "Value", "Hello world" ); %[output:717a7f33]
%[text] The rectangular text area is composed of an axes object, containing two children: a rectangle and a text box. The playback controls widget comprises play, pause, and stop buttons, with a label to display the current time, a slider to select the current time, and a spinner to control the playback rate.
%[text] ![](text:image:20fc)
